// src/App.js
import logo from "./logo.svg";
import "./css/App.css";
import Card from "./components/Card";

function App() {
  const renderGrid = () => {
    let grid = [];
    for (let i = 0; i < 16; i++) {
      grid.push(<Card key={i} />);
    }
    return grid;
  };

  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <div className="grid-container">{renderGrid()}</div>
      </header>
    </div>
  );
}

export default App;
